import { createRouter, createWebHistory } from "vue-router";
import HomeView from "../views/HomeView.vue";

const routes = [
  {
    path: "/",
    name: "home",
    component: HomeView,
  },
  // {
  //   path: '/company/register',
  //   name: 'CompanyRegister',
  //   component: () => import(/* webpackChunkName: "company/register" */ '../views/CompanyRegister.vue')
  // },
  {
    path: "/company/table",
    name: "CompanyTables",
    component: () =>
      import(
        /* webpackChunkName: "company/register" */ "../views/CompanyTable.vue"
      ),
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
